import React from "react";
function Search() {
  
    return (
      
      <div>
          <input title = "輸入角色名稱"></input>
          <select>
            <option>請選擇查詢關係</option>
            <option>family</option>
            <option>friend</option>
            <option>enemy</option>
            <option>teacher</option>
            <option>lover</option>
          </select>
          <button>搜尋</button>
      </div>
    );
  }
  
  export default Search;
